import React from 'react'
import './Logo.css'

export default function Logo () {
    return (
        <div className="logo-container">
            <img alt="logo" className="logo-img" src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQxipO7tbmdzoDUoWasNq2tO6FA45xbscSwlA&usqp=CAU" />
        </div>
    )
}
